import React from "react"
import style from "./MyPosts.module.css"
import NewPost from "./NewPost/NewPost";
import Post from "./Post/Post";

const MyPosts = (props) => {

    let postsElement = props.state.

    return (
        <div className={style.posts}>
            <h2>Posts</h2>
            <NewPost/>
            <div className={style.posts}>
                <Post/>
                <Post/>
            </div>
        </div>
    )
}

export default MyPosts
